import React, { useEffect, useState } from 'react';
import {
  Container,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Slider,
  Box,
  TextField,
  Stack
} from '@mui/material';

function App() {
  const [devices, setDevices] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedDevice, setSelectedDevice] = useState(null);

  useEffect(() => {
    fetch('http://localhost:5001/api/devices')
      .then(res => res.json())
      .then(data => {
        const formattedDevices = data.map(device => ({
          ...device,
          waterFlow: Array.isArray(device.waterFlow) ? device.waterFlow : [device.waterFlow],
          pressure: Array.isArray(device.pressure) ? device.pressure : [device.pressure],
          temperature: Array.isArray(device.temperature) ? device.temperature : [device.temperature]
        }));
        setDevices(formattedDevices);
      })
      .catch(err => console.error('Error fetching devices:', err));
  }, []);

  const handleDialogOpen = (device) => {
    setSelectedDevice({
      ...device,
      waterFlow: Array.isArray(device.waterFlow) ? device.waterFlow : [device.waterFlow],
      pressure: Array.isArray(device.pressure) ? device.pressure : [device.pressure],
      temperature: Array.isArray(device.temperature) ? device.temperature : [device.temperature]
    });
    setOpenDialog(true);
  };

  const handleDialogClose = () => {
    setOpenDialog(false);
    setSelectedDevice(null);
  };

  const handleUpdateDevice = (field, newValue) => {
    if (selectedDevice) {
      const updatedDevice = {
        ...selectedDevice,
        [field]: [...selectedDevice[field], newValue]
      };
      setDevices(devices.map(device => device.Did === updatedDevice.Did ? updatedDevice : device));
    }
  };

  return (
    <Container maxWidth="md">
      <Typography variant="h4" sx={{ mt: 4, mb: 2 }}>Water Management System</Typography>
      <Button variant="contained" sx={{ mb: 2 }} onClick={() => handleDialogOpen({ Did: '', waterFlow: [0], pressure: [0], temperature: [0] })}>
        Add Device
      </Button>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Device ID</TableCell>
              <TableCell>Latest Water Flow (L/s)</TableCell>
              <TableCell>Latest Pressure (psi)</TableCell>
              <TableCell>Latest Temperature (°C)</TableCell>
              <TableCell>Edit</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {devices.map((device) => (
              <TableRow key={device.Did}>
                <TableCell>{device.Did}</TableCell>
                <TableCell>{device.waterFlow.slice(-1)}</TableCell>
                <TableCell>{device.pressure.slice(-1)}</TableCell>
                <TableCell>{device.temperature.slice(-1)}</TableCell>
                <TableCell>
                  <Button onClick={() => handleDialogOpen(device)}>Edit</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      {selectedDevice && (
        <Dialog open={openDialog} onClose={handleDialogClose} fullWidth maxWidth="sm">
          <DialogTitle>Edit Device Data</DialogTitle>
          <DialogContent>
            <TextField
              autoFocus
              margin="dense"
              name="Did"
              label="Device ID"
              type="text"
              fullWidth
              variant="standard"
              value={selectedDevice.Did}
              onChange={e => setSelectedDevice({ ...selectedDevice, Did: e.target.value })}
            />
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Water Flow (L/s)</Typography>
              <Slider
                value={selectedDevice.waterFlow.slice(-1)[0] || 0}
                onChange={(e, val) => handleUpdateDevice('waterFlow', val)}
                min={0}
                max={500}
                step={1}
              />
            </Box>
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Pressure (psi)</Typography>
              <Slider
                value={selectedDevice.pressure.slice(-1)[0] || 0}
                onChange={(e, val) => handleUpdateDevice('pressure', val)}
                min={0}
                max={200}
                step={1}
              />
            </Box>
            <Box sx={{ mt: 2 }}>
              <Typography gutterBottom>Temperature (°C)</Typography>
              <Slider
                value={selectedDevice.temperature.slice(-1)[0] || 0}
                onChange={(e, val) => handleUpdateDevice('temperature', val)}
                min={-20}
                max={50}
                step={1}
              />
            </Box>
          </DialogContent>
          <DialogActions>
            <Button onClick={handleDialogClose}>Close</Button>
          </DialogActions>
        </Dialog>
      )}
    </Container>
  );
}

export default App;
